package assignments;

import java.util.HashMap;

class ConcatString
{
    //Function to remove common characters and concatenate two strings.
    public static String concatenatedString(String s1,String s2)
    {
        // Your code here
        String t = "";
        HashMap<Character,Integer> occurences = new HashMap<>();
        for(int i = 0;i<s1.length();i++) {
            occurences.put(s1.charAt(i),1);
        }
        for(int i = 0;i<s2.length();i++) {
            if(occurences.containsKey(s2.charAt(i))) {
                occurences.put(s2.charAt(i),2);
            } else {
                occurences.put(s2.charAt(i),1);
            }
        }
        for(int i = 0;i<s1.length();i++) {
            if(occurences.get(s1.charAt(i)) == 1) {
                t = t+ s1.charAt(i);
            }
        }
        for(int i = 0;i<s2.length();i++) {
            if(occurences.get(s2.charAt(i)) == 1) {
                t= t+ s2.charAt(i);
            }
        }
        if(t == "") {
            return "-1";
        }
        return t;
    }

    public static void main(String[] args) {

        String s = ConcatString.concatenatedString("","enrarreilbkffrvuywmmoxwejp");
        System.out.println(s);
    }
}

